<script>
export default {
  name: 'my-name-svg',
  methods: {
    darkenBackground() {
      let paths = document.querySelectorAll(`#logo path`)
      for (let i = 0; i < paths.length; i++) {
        setTimeout((function (index) {
          return function () {
            paths[index].style.fill = 'black'
          }
        })(i), 100 * (i + 1))
      }
    }
  },
  mounted() {
    setTimeout(() => this.darkenBackground(), 1000)
  }
}
</script>

